import React from "react";

const Card = (props) => {
  console.log("Hello", props);
  return (
    <div className="text-center bg-gray">
      <img src={props.data.banner} alt="image" className="card-pic" />

      <div className="card-body text-dark">
        <h4 className="card-title">{props.data.name}</h4>
        <p className="card-text text-secondary">Hello There Hello Hello</p>
      </div>
    </div>
  );
};

export default Card;
